import { useState } from "react";

function Navlinks() {
  const Navrouter = [["Home"], ["Blog"], ["Portafolio"], ["About"]];
  const [open, setOpen] = useState(false);
  const Navli = (
    <div>
      <nav className="px-3">
        {Navrouter.map(([title]) => (
          <div>
            <div className="text-left md:cursor-pointer">
              <a>{title}</a>
            </div>
          </div>
        ))}
      </nav>
    </div>
  );
    return(
        <div>
                  <div className="flex items-center font-medium justify-around">
        <div className="z-50 p-5 md:w-auto w-full flex justify-between">
          <p className="md:cursor-pointer">BIll</p>

          <div className="text-3xl md:hidden" onClick={() => setOpen(!open)}>
            <ion-icon name={`${open ? "close" : "menu"}`}></ion-icon>
          </div>
        </div>
      </div>
      <ul
        className={`md:hidden bg-gray-100 fixed w-full top-0 overflow-y-auto bottom-0 py-20 pl-4 duration-500 ${
          open ? "left-0" : "left-[-100%]"
        }`}
      >
        <Navlinks onClick={() => setOpen(!open)}/>
      </ul>
        </div>
    )
}

export default Navlinks;
